import React from 'react';
import '../../../App.css';

const list = (props) => { props.cities.map((cities,index) =>{
    return (
        <div className="Citys">
        <ul className="City-list">
            <li>Budva</li>
            <li>Podgorica</li>
            <li>Niksic</li>
            <li>Cetinje</li>
        </ul>
    </div>

    );
});      
}

export default list;
